import React, { useState } from 'react';
import './Pictures.css';
import { makeStyles } from '@material-ui/core/styles';
import { Button } from '@material-ui/core';

import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

import YourComponent from "./Something.js";


const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
  },
  gridList: {
    width: 750,
    height: 600,
    paddingLeft: 150,
  },
  button:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
  }
}));
export default function Pictures(props) {
  const [spacing, setSpacing] = React.useState(2);
  const classes = useStyles(); 
    return(
      <div className={classes.root}>
        <GridList cellHeight={150}className={classes.gridList} cols={1}>
        <div className={classes.button}>{props.name}</div>
          {props.link.map((tile) => (
            <GridListTile key={tile} cols={tile.cols || 1}>
                  <img src={tile} alt={tile}/>
            </GridListTile>
          ))}
          <div className={classes.button}>{props.description}</div>
        </GridList>

      </div>
    )
}
